import React from 'react';
import Main from './Main'
import './App.css';

function App() {
  return (
    <div className="App">
      <header><h1>Hello</h1></header>
      <div className="square">
        <div className="content">
           Hello!
        </div>
      </div>
    </div>
  );
}

export default App;
